import React from 'react';
import CustomNavBar from '../components/Navbar';
import { checkAuthenticated } from '../actions/auth';

const Dashboard = ({checkAuthenticated}) => {
    useEffect(() => {
        checkAuthenticated();
    }, []);

    <div className='container'>
        <CustomNavBar/>
        Dashboard
    </div>
};

export default connect(null, { checkAuthenticated })(Dashboard);
